import (
	context "context"
	rapiddocs "github.com/query-parameters/rapiddocs"
	rapiddocsclient "github.com/query-parameters/rapiddocs/client"
	uuid "github.com/google/uuid"
)

client := rapiddocsclient.NewClient()
response, err := client.User.GetUsername(
	context.TODO(),
	&rapiddocs.GetUsersRequest{
		Limit: 1,
		Id: uuid.MustParse(
			"d5e9c84f-c2b2-4bf4-b4b0-7ffd7a9ffc32",
		),
		Date: rapiddocs.MustParseDate(
			"2023-01-15",
		),
		Deadline: rapiddocs.MustParseDateTime(
			"2024-01-15T09:30:00Z",
		),
		Bytes: []byte("Hello world!"),
		User: &rapiddocs.User{
			Name: "name",
			Tags: []string{
				"tags",
				"tags",
			},
		},
		UserList: []*rapiddocs.User{
			&rapiddocs.User{
				Name: "name",
				Tags: []string{
					"tags",
					"tags",
				},
			},
			&rapiddocs.User{
				Name: "name",
				Tags: []string{
					"tags",
					"tags",
				},
			},
		},
		OptionalDeadline: rapiddocs.Time(
			rapiddocs.MustParseDateTime(
				"2024-01-15T09:30:00Z",
			),
		),
		KeyValue: map[string]string{
			"keyValue": "keyValue",
		},
		OptionalString: rapiddocs.String(
			"optionalString",
		),
		NestedUser: &rapiddocs.NestedUser{
			Name: "name",
			User: &rapiddocs.User{
				Name: "name",
				Tags: []string{
					"tags",
					"tags",
				},
			},
		},
		OptionalUser: &rapiddocs.User{
			Name: "name",
			Tags: []string{
				"tags",
				"tags",
			},
		},
		ExcludeUser: []*rapiddocs.User{
			&rapiddocs.User{
				Name: "name",
				Tags: []string{
					"tags",
					"tags",
				},
			},
		},
		Filter: []string{
			"filter",
		},
	},
)
